    Grayscale Image of the Sidescan Sonar Data From National Oceanic and Atmospheric
    Administration (NOAA) Survey H11076 of the Sea Floor in Quicks Hole, MA (H11076_GEO_1MSSS.TIF,
    Geographic)",nt"tracking_summary": {ntt"total": 4,ntt"recent": 1nt},nt"groups":
